%[text] ## Liver analysis pipeline
%[text] Main script to run the liver and tumor segmentation pipeline.
clear; clc; clf; close all; % Clean slate

disp("Liver Segmentation Pipeline Started"); %[output:8b42f2c5]

% --- Configuration Parameters ---
% General
config.verbose = true; % Flag for displaying intermediate images/messages
config.pauseDuration = 0.001; % Pause duration for visualizations

% Data Paths
config.imagePath = 'data/imagesTr/liver_80.nii.gz';
config.labelPath = 'data/labelsTr/liver_80.nii.gz';

% Preprocessing
config.roiParams = struct('x', 35, 'y', 38, 'r', 30); % For initial normalization
config.maxValue = uint16(65535); % Max value for uint16 images
config.nBins = 65536;
config.histGroupSize = 2000;

% Bone Removal Pass 1
config.boneRemoval1.window = 10;
config.boneRemoval1.thresholdFactor = 0.95;
config.boneRemoval1.dilateDiskRadius = 4;
config.boneRemoval1.erodeDiskRadius = 2;
config.boneRemoval1.gaussianSize = 10;

% Stretching Pass 1
config.stretch1.stretchFactor = 8;

% Bone Masking Pass 2 (Mask Array)
config.boneMask2.thresholdFactor = 0.13; % Applied to doubleStretchedSlice_temp
config.boneMask2.dilateDiskRadius = 4;
config.boneMask2.erodeDiskRadius = 4;
config.boneMask2.gaussianSize = 10;

% Histogram Matching
config.histMatch.referenceSliceIndex = 150; % Example, adjust as needed

% Bilateral Filtering Pass 1
config.bilatFilt1.DoS = 0.04; % Degree of Smoothing
config.bilatFilt1.sSigma = 4;  % Spatial Sigma

% Liver Segmentation (Initial Thresholding)
config.liverSeg.lowerThreshold = 0.06;
config.liverSeg.upperThreshold = 0.28;
config.liverSeg.imfillConn = 18;
config.liverSeg.openStrelDiskSize = 5;

% Liver Segmentation (2D Refinement)
config.liverRefine2D.minLiverArea = 100;
config.liverRefine2D.seCloseDisk = 7;
config.liverRefine2D.seOpenDisk = 5;

% Liver Segmentation (3D Refinement)
config.liverRefine3D.sphereStrelRadius = 4;
config.liverRefine3D.minLiverVolumeVoxels = 300000;
config.liverRefine3D.connectivity = 18;

% Liver Mask Post-Processing
config.liverPostProcess.nRowsFractionForBottom = 1.5;
config.liverPostProcess.connectivity3D = 26;

% Final Stretching
config.stretchFinal.lowerIntensityFactor = 0.42;
config.stretchFinal.upperIntensityFactor = 0.55;
config.stretchFinal.stretchFactor = 2;

% Bilateral Filtering Pass 2
config.bilatFilt2.DoS = 0.04;
config.bilatFilt2.sSigma = 7;

% Tumor Segmentation
config.tumorSeg.lowerThreshold = 0.03;
config.tumorSeg.upperThreshold = 0.23;
config.tumorSeg.minTumorVolumeVoxels = 30000;
config.tumorSeg.openStrelSphereRadius = 5;
config.tumorSeg.closeStrelDiskRadius2D = 3;
config.tumorSeg.connectivity3D = 18;

% 3D Reconstruction
config.recon3D.liverColor = [0 1 0];
config.recon3D.tumorColor = [1 0 0];
config.recon3D.bonesColor = [0.9 0.9 0.8];
config.recon3D.liverAlpha = 0.4;
config.recon3D.tumorAlpha = 1.0;
config.recon3D.bonesAlpha = 0.7;
config.recon3D.smoothing = true;
config.recon3D.smoothFactor = 5;

%%
%[text] ### Pipeline Stages
%%
% 1. Load Data

disp('1. Loading data...'); %[output:4cca286b]
[trainVolume, labelVolume] = data_io.loadNiiVolumes(...
    config.imagePath, ...
    config.labelPath);
fprintf('Training volume size: %s\n', mat2str(size(trainVolume))); %[output:8a0ea526]
if config.verbose %[output:group:59a2bee8]
    visualization.viewVolumeSlices(... %[output:323230dc]
        trainVolume, ... %[output:323230dc]
        labelVolume, ... %[output:323230dc]
        'Original Data', ... %[output:323230dc]
        config.pauseDuration); %[output:323230dc]
end %[output:group:59a2bee8]

%%
% 2. ROI-based Normalization

disp('2. Normalizing volume based on ROI...'); %[output:7b721830]
[normalizedSlice, roiMeanValue] = preprocessing.normalizeVolumeByRoi(...
    trainVolume, ...
    config.roiParams, ...
    config.maxValue);
fprintf('Mean value in ROI for normalization: %.2f\n', roiMeanValue); %[output:92d54010]

%%
% 3. Initial Histogram Analysis

disp('3. Initial histogram analysis...'); %[output:48e547e4]
[hMean, hMean_clean] = histogram_tools.calculateVolumeHistogram(...
    normalizedSlice, ...
    config.nBins);
if config.verbose %[output:group:5fdd9bd5]
    visualization.plotHistogramComparison(... %[output:3ed2c1e3]
        hMean, ... %[output:3ed2c1e3]
        hMean_clean, ... %[output:3ed2c1e3]
        'Initial Histograms'); %[output:3ed2c1e3]
end %[output:group:5fdd9bd5]
[grouped_hMean, grouped_hMean_clean, binCenters] = histogram_tools.groupHistogram(...
    hMean, ...
    hMean_clean, ...
    config.histGroupSize, ...
    config.nBins);
[lowerIntensity1, upperIntensity1] = histogram_tools.detectHistogramBand(grouped_hMean_clean);
if config.verbose %[output:group:96117d36]
    visualization.plotGroupedHistogramWithBand(... %[output:60984c03]
        binCenters, ... %[output:60984c03]
        grouped_hMean, ... %[output:60984c03]
        grouped_hMean_clean, ... %[output:60984c03]
        config.nBins, ... %[output:60984c03]
        lowerIntensity1, ... %[output:60984c03]
        upperIntensity1, ... %[output:60984c03]
        'Grouped Histograms - Band 1'); %[output:60984c03]
end %[output:group:96117d36]

%%
% 4. Stretch Slices (Pass 1)

disp('4. Stretching slices (Pass 1)...'); %[output:03b48f5b]
nSlices_stretch1 = size(normalizedSlice, 3);
wb_stretch1 = waitbar(0, 'Stretching Slices (Pass 1) - Initializing...'); %[output:63a9f1fd]

stretchedSlice1 = preprocessing.stretchVolumeContrast(... %[output:group:92c6883c] %[output:67561a24]
    normalizedSlice, ... %[output:67561a24]
    lowerIntensity1, ... %[output:67561a24]
    upperIntensity1, ... %[output:67561a24]
    config.stretch1.stretchFactor, ... %[output:67561a24]
    config.maxValue, ... %[output:67561a24]
    wb_stretch1); %[output:group:92c6883c] %[output:67561a24]

if isvalid(wb_stretch1), close(wb_stretch1); end

%%
% 5. Bone Removal (Pass 1)

disp('5. Removing bone structures (Pass 1)...'); %[output:59079528]
[no_bones_slice, bones_mask_pass1] = preprocessing.removeHighIntensityArtifacts(... %[output:group:76e175e7] %[output:6e32e3af]
    normalizedSlice, ... %[output:6e32e3af]
    stretchedSlice1, ... %[output:6e32e3af]
    config.maxValue, ... %[output:6e32e3af]
    config.boneRemoval1, ... %[output:6e32e3af]
    config.verbose, ... %[output:6e32e3af]
    config.pauseDuration); %[output:group:76e175e7] %[output:6e32e3af]

%%
% 6. Histogram Analysis After Bone Removal

disp('6. Histogram analysis after bone removal...'); %[output:44d3686d]
[hMean_no_bones, hMean_clean_no_bones] = histogram_tools.calculateVolumeHistogram(...
    no_bones_slice, ...
    config.maxValue);
[grouped_hMean_no_bones, grouped_hMean_clean_no_bones, binCenters_nb] = ...
    histogram_tools.groupHistogram(...
        hMean_no_bones, ...
        hMean_clean_no_bones, ...
        config.histGroupSize, ...
        config.maxValue);
[lowerIntensity2, upperIntensity2] = histogram_tools.detectHistogramBand(grouped_hMean_clean_no_bones);
if config.verbose %[output:group:3aecca6d]
    visualization.plotGroupedHistogramWithBand(... %[output:89193f51] %[output:0736401b]
        binCenters_nb, ... %[output:89193f51] %[output:0736401b]
        grouped_hMean_no_bones, ... %[output:89193f51] %[output:0736401b]
        grouped_hMean_clean_no_bones, ... %[output:89193f51] %[output:0736401b]
        config.maxValue, ... %[output:89193f51] %[output:0736401b]
        lowerIntensity2, ... %[output:89193f51] %[output:0736401b]
        upperIntensity2, ... %[output:89193f51] %[output:0736401b]
        'Histograms After Bone Removal - Band 2'); %[output:89193f51] %[output:0736401b]
end %[output:group:3aecca6d]

%%
% 7. Double Stretching (Stretch Slices Pass 2)

disp('7. Stretching slices (Pass 2)...'); %[output:3a5a7b0c]
nSlices_stretch2 = size(no_bones_slice, 3);
wb_stretch2 = waitbar(0, 'Stretching Slices (Pass 2) - Initializing...');

doubleStretchedSlice = preprocessing.stretchVolumeContrast(...
    no_bones_slice, ...
    lowerIntensity2, ...
    upperIntensity2, ...
    6, ... % Stretch factor 6 from script
    config.maxValue, ...
    wb_stretch2);

if isvalid(wb_stretch2), close(wb_stretch2); end

if config.verbose
    visualization.viewVolumeSlices(doubleStretchedSlice, [], 'Double Stretched Slices', config.pauseDuration);
end

%%
% 8. Create Mask Array (Bone Removal Pass 2)

disp('8. Creating secondary bone/structure mask...'); %[output:57780a8f]
structure_mask_array = preprocessing.createStructureMask(... %[output:group:1e11a439] %[output:65a16716]
    doubleStretchedSlice, ... %[output:65a16716]
    config.maxValue, ... %[output:65a16716]
    config.boneMask2, ... %[output:65a16716]
    config.verbose, ... %[output:65a16716]
    config.pauseDuration); %[output:group:1e11a439] %[output:65a16716]

%%
% 9. Histogram Matching

disp('9. Applying histogram matching...'); %[output:9d9fc126]
nSlices_histmatch = size(doubleStretchedSlice, 3);
wb_histmatch = waitbar(0, 'Histogram Matching - Initializing...');

matched_after_double_stretch = preprocessing.matchHistogramToReference(...
    doubleStretchedSlice, ...
    config.histMatch.referenceSliceIndex, ...
    wb_histmatch);

if isvalid(wb_histmatch), close(wb_histmatch); end

%%
% 10. Apply Structure Mask

disp('10. Applying structure mask...'); %[output:9966942d]
masked_volume = preprocessing.applyMask(...
    matched_after_double_stretch, ...
    structure_mask_array);
if config.verbose %[output:group:5cb3a6d9]
     visualization.viewVolumeSlices(masked_volume, [], 'Volume After Structure Mask', config.pauseDuration); %[output:5b048480]
end %[output:group:5cb3a6d9]

%%
% 11. Bilateral Filtering (Pass 1)

disp('11. Applying bilateral filter (Pass 1)...'); %[output:30304b31]
nSlices_bilat1 = size(masked_volume, 3);
wb_bilat1 = waitbar(0, 'Bilateral Filtering (Pass 1) - Initializing...');

bilat_filtered_volume1 = preprocessing.applyBilateralFilter(...
    masked_volume, ...
    config.bilatFilt1.DoS, ...
    config.bilatFilt1.sSigma, ...
    config.maxValue, ...
    wb_bilat1);

if isvalid(wb_bilat1), close(wb_bilat1); end

if config.verbose %[output:group:858ad5c3]
    visualization.viewVolumeSlices(bilat_filtered_volume1, masked_volume, 'Bilateral Filter vs Before', config.pauseDuration); %[output:1dcc1642]
end %[output:group:858ad5c3]

%%
%[text] ### Liver Segmentation

disp('--- Starting Liver Segmentation ---'); %[output:7342dccd]

%%
% 12. Get Initial Liver Thresholds (Optional)
% sliceForROI = bilat_filtered_volume1(:,:,156);
% [manualLower, manualUpper] = visualization.getThresholdsFromRoiInteractive(sliceForROI, 'Draw ROI on Liver for Thresholds');
% config.liverSeg.lowerThreshold = manualLower;
% config.liverSeg.upperThreshold = manualUpper;
% fprintf('Using thresholds from ROI: Lower=%.3f, Upper=%.3f\n', config.liverSeg.lowerThreshold, config.liverSeg.upperThreshold);
%%
% 13. Initial Liver Segmentation (2D Thresholding & MorphOps)

disp('13. Initial liver segmentation (2D)...'); %[output:4ba7f77e]
initialLiverMask = segmentation.segmentLiverByThreshold2D(... %[output:group:60d1d9f8] %[output:237750ae]
    bilat_filtered_volume1, ... %[output:237750ae]
    config.liverSeg.lowerThreshold, ... %[output:237750ae]
    config.liverSeg.upperThreshold, ... %[output:237750ae]
    config.liverSeg.imfillConn, ... %[output:237750ae]
    config.liverSeg.openStrelDiskSize, ... %[output:237750ae]
    config.verbose, ... %[output:237750ae]
    config.pauseDuration); %[output:group:60d1d9f8] %[output:237750ae]

%%
% 14. Refine Liver Segmentation (2D MorphOps)

disp('14. Refining liver segmentation (2D)...'); %[output:301e2e73]
refinedLiverMask2D = segmentation.refineLiverMask2D(... %[output:group:1f0d1acd] %[output:1694d8e4]
    initialLiverMask, ... %[output:1694d8e4]
    config.liverRefine2D.minLiverArea, ... %[output:1694d8e4]
    config.liverRefine2D.seCloseDisk, ... %[output:1694d8e4]
    config.liverRefine2D.seOpenDisk, ... %[output:1694d8e4]
    config.verbose, ... %[output:1694d8e4]
    config.pauseDuration); %[output:group:1f0d1acd] %[output:1694d8e4]

%%
% 15. Refine Liver Segmentation (3D MorphOps)

disp('15. Refining liver segmentation (3D)...'); %[output:314fc964]
refinedLiverMask3D = segmentation.refineMask3DLargestComponent(... %[output:group:47dc42ec] %[output:4a4d05f1]
    initialLiverMask, ... %[output:4a4d05f1]
    config.liverRefine3D.sphereStrelRadius, ... %[output:4a4d05f1]
    config.liverRefine3D.minLiverVolumeVoxels, ... %[output:4a4d05f1]
    config.liverRefine3D.connectivity, ... %[output:4a4d05f1]
    config.verbose, ... %[output:4a4d05f1]
    config.pauseDuration, ... %[output:4a4d05f1]
    bilat_filtered_volume1); %[output:group:47dc42ec] %[output:4a4d05f1]

%%
% 16. Post-process Liver Mask

disp('16. Post-processing liver mask (connectivity)...'); %[output:699fbafc]
finalProcessedLiverMask = segmentation.postProcessLiverMaskConnectivity(... %[output:group:2ae25678] %[output:512f9c7e]
    refinedLiverMask3D, ... %[output:512f9c7e]
    size(trainVolume,1), ... %[output:512f9c7e]
    config.liverPostProcess.nRowsFractionForBottom, ... %[output:512f9c7e]
    config.liverPostProcess.connectivity3D, ... %[output:512f9c7e]
    config.verbose, ... %[output:512f9c7e]
    config.pauseDuration, ... %[output:512f9c7e]
    bilat_filtered_volume1); %[output:group:2ae25678] %[output:512f9c7e]

%%
%[text] ### Tumor Segmentation

disp('--- Starting Tumor Segmentation ---'); %[output:97195aa0]

%%
% 17. Prepare Volume for Tumor Segmentation

liverOnlyVolume = preprocessing.applyMask(...
    no_bones_slice, ...
    finalProcessedLiverMask);
if config.verbose %[output:group:92449774]
    visualization.viewVolumeSlices(liverOnlyVolume, [], 'Liver-Only Intensity Volume (Pre-Tumor Seg)', config.pauseDuration); %[output:67c0bf53]
end %[output:group:92449774]

%%
% 18. Histogram Analysis and Stretching for Liver-Only Volume (Optional)
% [hMean_final, hMean_clean_final] = histogram_tools.calculateVolumeHistogram(liverOnlyVolume, config.maxValue, true);
% [~, ~, binCenters_final] = histogram_tools.groupHistogram(hMean_final, hMean_clean_final, config.histGroupSize, config.maxValue);
% [lowerIntensity_final, upperIntensity_final] = histogram_tools.detectHistogramBand(hMean_clean_final, 3000);
% if config.verbose
%     visualization.plotGroupedHistogramWithBand(binCenters_final, hMean_final, hMean_clean_final, config.maxValue, lowerIntensity_final, upperIntensity_final, 'Histograms for Final Stretch');
% end
% stretched_liver_only = preprocessing.stretchVolumeContrast(liverOnlyVolume, lowerIntensity_final, upperIntensity_final, config.stretchFinal.stretchFactor, config.maxValue);
% matched_stretched_liver_only = preprocessing.matchHistogramToReference(stretched_liver_only, config.histMatch.referenceSliceIndex);
% masked_matched_stretched_liver_only = preprocessing.applyMask(matched_stretched_liver_only, finalProcessedLiverMask);
% inputToTumorSeg = masked_matched_stretched_liver_only;

inputToTumorSeg_intensities = preprocessing.applyMask(...
    bilat_filtered_volume1, ...
    finalProcessedLiverMask);
%%
% 19. Bilateral Filtering for Tumor Segmentation Input (Pass 2)

disp('19. Applying bilateral filter (Pass 2) for tumor segmentation input...'); %[output:557cabe8]
bilat_filtered_for_tumors = preprocessing.applyBilateralFilter(...
    inputToTumorSeg_intensities, ...
    config.bilatFilt2.DoS, ...
    config.bilatFilt2.sSigma, ...
    config.maxValue);
if config.verbose
    visualization.viewVolumeSlices(bilat_filtered_for_tumors, labelVolume, 'Input to Tumor Segmentation vs Label', config.pauseDuration);
end

%%
% 20. Tumor Segmentation

disp('20. Segmenting tumors...'); %[output:03d8cb79]
% sliceForTumorROI = bilat_filtered_for_tumors(:,:,157);
% [manualTumorLower, manualTumorUpper] = visualization.getThresholdsFromRoiInteractive(sliceForTumorROI, 'Draw ROI on Tumor for Thresholds');
% config.tumorSeg.lowerThreshold = manualTumorLower;
% config.tumorSeg.upperThreshold = manualTumorUpper;
% fprintf('Using tumor thresholds from ROI: Lower=%.3f, Upper=%.3f\n', config.tumorSeg.lowerThreshold, config.tumorSeg.upperThreshold);

finalTumorMask = segmentation.segmentTumors(... %[output:group:48c9c719] %[output:15c17c36]
    bilat_filtered_for_tumors, ... %[output:15c17c36]
    finalProcessedLiverMask, ... %[output:15c17c36]
    config.tumorSeg.lowerThreshold, ... %[output:15c17c36]
    config.tumorSeg.upperThreshold, ... %[output:15c17c36]
    config.tumorSeg.minTumorVolumeVoxels, ... %[output:15c17c36]
    config.tumorSeg.openStrelSphereRadius, ... %[output:15c17c36]
    config.tumorSeg.closeStrelDiskRadius2D, ... %[output:15c17c36]
    config.tumorSeg.connectivity3D, ... %[output:15c17c36]
    config.verbose, ... %[output:15c17c36]
    config.pauseDuration, ... %[output:15c17c36]
    labelVolume); %[output:group:48c9c719] %[output:15c17c36]

%%
%[text] ### Evaluation

disp('--- Evaluating Segmentation ---'); %[output:4f12b3cc]

%%
% 21. Calculate Metrics
[metrics, predictionVolume] = evaluation.calculateSegmentationMetrics(...
    labelVolume, ...
    finalProcessedLiverMask, ...
    finalTumorMask);
evaluation.displayMetrics(metrics); %[output:338665d4]

if config.verbose %[output:group:34a9d145]
    disp('Visualizing comparison: GT vs. Prediction...'); %[output:3e3f1fb9]
    baseImgForComparison = bilat_filtered_for_tumors;
    visualization.displaySegmentationComparisonGUI(...
        baseImgForComparison, ...
        labelVolume, ...
        predictionVolume);
    % visualization.plotSegmentationAndGT(baseImgForComparison, labelVolume, finalProcessedLiverMask, finalTumorMask, 'Segmentation vs Ground Truth', config.pauseDuration);
end %[output:group:34a9d145]

%%
%[text] ### 3D Reconstruction
%%
if config.verbose %[output:group:4682135b]
    disp('--- Performing 3D Reconstruction ---'); %[output:1a3fcbb2]
    bones_mask_for_3d = morph_ops.openVolume(...
        bones_mask_pass1, ...
        strel('sphere', 2));

    visualization.render3DSegmentation(... %[output:44961d31] %[output:8b5cbc08]
        finalProcessedLiverMask, ... %[output:44961d31] %[output:8b5cbc08]
        finalTumorMask, ... %[output:44961d31] %[output:8b5cbc08]
        bones_mask_for_3d, ... %[output:44961d31] %[output:8b5cbc08]
        config.recon3D); %[output:44961d31] %[output:8b5cbc08]
end %[output:group:4682135b]
%%
disp("Liver Segmentation Pipeline Finished");

